import { Link } from "react-router-dom";
import { EyeOutline } from "react-ionicons";

function ViewBtn({ deck }) {
  return (
    <Link to={`/decks/${deck.id}`} type="button" className="btn btn-secondary">
      <EyeOutline
        color={"#00000"}
        title={"view-deck"}
        style={{ marginRight: "10px" }}
      />
      View
    </Link>
  );
}

export default ViewBtn;
